import React from "react";

function Navbar() {

    return(
        <nav className="nav">
            <img className="nav-img" src="cart.png" alt="cart" />
            <h1>UOS</h1>
            <ul>
                <li>Admin</li>
                <li>Sign in</li>
                <li>Register</li>
            </ul>
        </nav>

        
    )
    
}

export default Navbar
